import React from 'react'
import { FaHome } from "react-icons/fa";

import Groups from "./Middle-clone/Groups";
import '../App.css' 
import Friends from './Friends';

function Home() {
    return (
        <div className="middle-div">
          <FaHome style={{height:'30px',width:'30px'}}></FaHome>  
          <Friends></Friends>
          <Groups></Groups>
        </div>
    )
}

export default Home
